import {LoadableComponent} from '../utils/LoadableComponent'

import order from '../pages/order/order'

import tables from '../pages/tables/tables'
import user from '../pages/user/user'
import channel from '../pages/channel/channel'
import pay from '../pages/pay/pay'
import unusualUser from "../pages/user/unusualUser"
// const order = LoadableComponent(() => import('../pages/order/order'))
console.log(LoadableComponent)
export default {
    menu: [
        {
            path: '/home/order/order',
            name: '工单管理',
            component: order
        }, {
            path: '/home/tables/tables',
            name: '表格',
            component: tables
        }, {
            path: '/home/channel/channel',
            name: '渠道管理',
            component: channel
        }, {
            path: '/',
            name: '用户管理',
            children: [
                {
                    name: ' 异常用户',
                    component: unusualUser,
                    path: '/home/user/unusualUser'
                }, {
                    name: ' 正常用户',
                    component: user,
                    path: '/home/user/user'
                }
            ]
        }, {
            path: '/home/pay/pay',
            name: '财务管理',
            component: pay
        }
    ]
}
